import PySimpleGUI as sg
import os
import rutas
import src.pantallas.caracteristicas_generales as cg


def eleccion_dataset():
    sg.theme(cg.TEMA)
    ruta_icon_png = os.path.join(rutas.IMAGENES_DIR, 'cartas_icon.png')
    ruta_icon_ico = os.path.join(rutas.IMAGENES_DIR, 'cartas_icon.ico')

    fifa = (b'')
    spotify = (b'')
    peliculas = (b'')
    volcanes = (b'')

    columna_1 = [[sg.Text('Fifa', font=cg.FUENTE_BOTONES)],
                 [sg.Button('', image_data=fifa, image_size=(150, 150),
                            button_color=(sg.theme_background_color(), sg.theme_background_color()),
                            border_width=3, key='fifa')]
                 ]
    columna_2 = [[sg.Text('Pelculas', font=cg.FUENTE_BOTONES)],
                 [sg.Button('', image_data=peliculas, image_size=(150, 150),
                            button_color=(sg.theme_background_color(), sg.theme_background_color()),
                            border_width=3, key='peliculas')]
                 ]
    columna_3 = [[sg.Text('Spotify', font=cg.FUENTE_BOTONES)],
                 [sg.Button('', image_data=spotify, image_size=(150, 150),
                            button_color=(sg.theme_background_color(), sg.theme_background_color()),
                            border_width=3, key='spotify')]
                 ]
    columna_4 = [[sg.Text('Volcanes', font=cg.FUENTE_BOTONES)],
                 [sg.Button('', image_data=volcanes, image_size=(150, 150),
                            button_color=(sg.theme_background_color(), sg.theme_background_color()),
                            border_width=3, key='volcanes')]
                 ]

    layout = [[sg.Frame('', [[sg.Text('Eleg la temtica para jugar:', font=cg.FUENTE_INDICADOR, pad=((10, 0), (2, 20)))],
              [sg.Column(columna_1, element_justification='c', pad=20),
               sg.Column(columna_2, element_justification='c', pad=20),
               sg.Column(columna_3, element_justification='c', pad=20),
               sg.Column(columna_4, element_justification='c', pad=20)],
              [sg.Button('Cancelar', font=cg.FUENTE_BOTONES, pad=((10, 0), (20, 5)), tooltip='Volver al men principal')]])
               ]]

    window = sg.Window('Eleccin de temtica', layout, finalize=True, use_custom_titlebar=True,
                       titlebar_icon=ruta_icon_png, icon=ruta_icon_ico, margins=(20, 20))

    return window
